import request from '@/utils/request';
export default {
  getList: function getList(params) {
    return request({
      url: '/article/list',
      method: 'get',
      params: params
    });
  },
  save: function save(params) {
    return request({
      url: '/article',
      method: 'post',
      data: params
    });
  },
  remove: function remove(id) {
    return request({
      url: '/article',
      method: 'delete',
      params: {
        id: id
      }
    });
  },
  get: function get(id) {
    return request({
      url: '/article',
      method: 'get',
      params: {
        id: id
      }
    });
  }
};
